import React from "react";
import "../Principal.css";

export default function Principal() {
  const funcionarios = [
    "Funcionario 1",
    "Funcionario 2",
    "Funcionario 3",
    "Funcionario 4",
    "Funcionario 5",
    "Funcionario 6",
    "Funcionario 7",
    "Funcionario 8",
  ];

  return (
    <div className="vista1-container">
      {/* Banner */}
      <div className="banner">
        {/* Logo */}
        <div
          className="logo"
          style={{ backgroundImage: "url('/image.png')" }}
        ></div>

        {/* Título */}
        <div className="portal-title">Portal de Medicamentos ELEAM</div>

        {/* Botones */}
        <div className="banner-buttons">
          <button className="btn-login">Iniciar Sesión</button>
          <button className="btn-diagnostico">Diagnóstico Paciente</button>
        </div>
      </div>

      {/* Grid de funcionarios */}
      <div className="funcionarios-grid">
        {funcionarios.map((nombre, index) => (
          <div key={index} className="funcionario-card">
            <div
              className="foto-funcionario"
              style={{ backgroundImage: "url('/funcionario.png')" }}
            ></div>
            <div className="nombre-funcionario">{nombre}</div>
          </div>
        ))}
      </div>
    </div>
  );
}
